    }, []);

    const [fullpriziv, setFullpriziv] = useState([]);

    return (
        <div>
                <div key={fullpriziv.id}>
                    <ul>
                        <Link to="/books">Книги</Link> / <Link to={`/${fullpriziv.id}`}>{fullpriziv.id}</Link>
