                        <div className={"name"}><a>Имя:</a> {fullpriziv.name}</div>
                        <div className={"name"}><a>Отчество:</a> {fullpriziv.patronymic}</div>
                        <div className={"name"}><a>Категория:</a> {fullpriziv.categoriya}</div>
                        <div className={"name"}><a>Возраст:</a> {fullpriziv.vozrast}</div>
                        <div className={"name"}><a>Наличие отсрочки:</a> {fullpriziv.otsrochka}</div>
